import React, { useState } from 'react';
import styled from "styled-components";
import getFinalBudget from '../Helper';
import datos from '../datos.json';

const Field = styled.div`
  display: flex;
  margin-bottom: 1rem;
  align-items: center;
`;

const Label = styled.label`
  flex: 0 0 100px;
`;

const Select= styled.select`
  display: block;
  width: 100%;
  padding: 1rem;
  border: 1px solid #e1e1e1;
  -webkit-appearance: none;
`;

const Radio = styled.input`
  margin: 0 1rem;
`;

const Button = styled.button`
  background-color: #00838f;
  width: 100%;
  padding: 1rem;
  color: #ffffff;
  text-transform: uppercase;
  font-weight: bold;
  border: none;
  transition: background-color .3s ease;
  margin-top: 2rem;
  &:hover {
    background-color: #26c6da;
    cursor: pointer;
  }
  &:focus {
    outline: none;
  }
`;

const Error = styled.div`
  color: #721c24;
  background-color: #f8d7da;
  border-color: #f5c6cb;
  padding: 1rem;
  text-align: center;
  margin-top: 20px;
`;

const Form = ({ setBudgetObj }) => {
  const [formData, setFormData] = useState({
    category: '',
    type: '',
    squareMeters: '',
  });

  const [error, setError] = useState(false);

  const { category, type, squareMeters } = formData;

  const fieldHandle = e => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const submitForm = e => {
    e.preventDefault();
    if (category.trim() === '' || type.trim() === '' || squareMeters.trim() === '') {
      setError(true);
      return;
    }
    setError(false);

    // Obtener el factor correspondiente a la categorÃ­a y tipo seleccionados
    const selectedProperty = datos.find(item => item.categoria === category && item.tipo === type);
    const factor = selectedProperty ? selectedProperty.factor : 1.0;

    // Calcular la cantidad presupuestada utilizando el factor y la cantidad de metros cuadrados
    const budgetAmount = getFinalBudget(2000, category, type) * factor * parseFloat(squareMeters) * 35.86;

    setBudgetObj({
      formData,
      budgetAmount,
    });
    setFormData({
      category: '',
      type: '',
      squareMeters: '',
    });
  };

  return (
    <form onSubmit={submitForm}>
      <div>
        <label>CategorÃ­a:</label>
        <select
          name="category"
          value={category}
          onChange={fieldHandle}
        >
          <option value="">-- Seleccione --</option>
          <option value="propiedad">Propiedad</option>
          <option value="ubicacion">UbicaciÃ³n</option>
        </select>
      </div>

      <div>
        <label>Tipo:</label>
        <select
          name="type"
          value={type}
          onChange={fieldHandle}
        >
          <option value="">-- Seleccione --</option>
          <option value="Casa">Casa</option>
          <option value="P.H.">P.H.</option>
          <option value="Depto. Edificio">Depto. Edificio</option>
          <option value="Barrio Privado">Barrio Privado</option>
          <option value="Oficina">Oficina</option>
          <option value="Local Comercial">Local Comercial</option>
          <option value="DepÃ³sito LogÃ­stica">DepÃ³sito LogÃ­stica</option>
          <option value="CABA">CABA</option>
          <option value="Tandil">Tandil</option>
          <option value="Costa AtlÃ¡ntica">Costa AtlÃ¡ntica</option>
          <option value="Patagonia">Patagonia</option>
        </select>
      </div>

      <div>
        <label>Metros Cuadrados:</label>
        <input
          type="number"
          name="squareMeters"
          value={squareMeters}
          onChange={fieldHandle}
        />
      </div>

      <button type="submit">Cotizar</button>

      {error ? <Error>Error: Completar los campos del formulario.</Error> : null}
    </form>
  );
};

export default Form;
